# Read in the input
n = int(input())
cafes = [int(x) for x in input().split()]

# Create a dictionary with the last time each cafe was visited
cafe_last_visit = {}
for cafe in cafes:
    cafe_last_visit[cafe] = cafe_last_visit.get(cafe, 0) + 1

# Find the cafe that was last visited the longest ago
last_visit = max(cafe_last_visit.values())
for cafe in cafe_last_visit:
    if cafe_last_visit[cafe] == last_visit:
        print(cafe)
        break
